import React, { Component } from 'react';
import "./Enemy.css";
import HeroItems from "./HeroItems.js"

class Enemy extends Component {

    render() {
        return (
            <HeroItems items={this.props.items} stats={this.props.stats} HP={this.props.stats[0].value}/>
        );
    }
}

export default Enemy;
